class ConsultantModel {
  ConsultantModel({
      List<Items>? items,}){
    _items = items;
}

  ConsultantModel.fromJson(dynamic json) {
    if (json['items'] != null) {
      _items = [];
      json['items'].forEach((v) {
        _items?.add(Items.fromJson(v));
      });
    }
  }
  List<Items>? _items;
ConsultantModel copyWith({  List<Items>? items,
}) => ConsultantModel(  items: items ?? _items,
);
  List<Items>? get items => _items;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_items != null) {
      map['items'] = _items?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

